import React from 'react';
import Task from './task';

const A = {'name': "Asgdfg", "isComplete": "false", "id": "1"};
function App() {
  return(
    <div>
      <h1>My Todos</h1>
      <Task task={A}/>
    </div>
  );
}

export default App;
